import React from "react";
import { Link } from "react-router-dom";
import { ShoppingCart } from "phosphor-react";
import "./navbar.css";

export const Navbar = () => {
    return (
        <div className="navbar">
            <a href="/" className="site-name">
                Vintage Guitars
            </a>
            <div className="links-container">
                <div className="links">
                    <Link to="/"> Shop </Link>
                    <Link to="/cart">
                        <ShoppingCart size={30} />
                    </Link>
                </div>
            </div>
        </div>
  );
}
